INSERT INTO `riwayat_inovasi` VALUES ('9cb8a10d-dfff-4ae4-9775-3714ee9082d0', 'Sistem Informasi Manajemen Praktik Kerja Lapangan (SIM-PKL)', '2021', 'Perangkat Lunak', 'SIM-PKL memiliki fitur untuk pengolahan data penempatan siswa PKL, pembuatan jurnal kegiatan PKL oleh siswa, kerjasama dengan Dunia Usaha Dunia Industri dan Dunia Kerja (DUDIKA), serta penugasan guru pembimbing PKL di SMK Negeri 11 Malang hingga proses penilaian dan cetak sertifikat PKL.', '2024-08-09 01:44:59', '2024-08-09 01:44:59', '9c099117-0e10-4128-92d4-b66d7a773544');
