INSERT INTO `riwayat_inovasi` VALUES ('9cec23ce-dede-447b-85aa-73a6b767ef30', 'JUPRI SALIN', '2024', 'TERAPAN', 'Persalinan pervaginam ( melalui jalan lahir ) merupakan persalinan yang di dambakan oleh rata rata wanita. Secara psikologis proses persalinan sering membuat takut,khawatir. Dukungan dan support dari orang terdekat sangat dibutuhkan.Kadang wanita juga merasa malu, risih karena proses persalinan harus membuka / memperlihatkan hal yang sifatnya privasi. Oleh karena itu untuk membantu menjaga privasi tersebut, muncullah ide JUPRI SALIN ini. Baju Privasi Saat Persalinan ( JUPRI SALIN ) ini merupakan ide sederhana yang diharapkan kebermanfaatannya', '2024-09-03 16:17:49', '2024-09-03 16:17:49', '1317b45c-acb0-459d-b65a-c4b445ea8f7e');
